import Nam1 from "./image/anh1.jpg";
function App() {
  return (
    <div className="flex justify-center">
      <Anh1 />
    </div>
  );
}

const Anh1 = () => {
  return (
    <div
      className="h-[1000px] w-[500px]   bg-center bg-cover "
      style={{ backgroundImage: `url(${Nam1})` }}
    ></div>
  );
};

export default App;
